import React from "react";

import "../node_modules/bootstrap/dist/css/bootstrap.css";
import "./Card.css";
import "./Cards_data";

const Card = props => {
  return(
    <div className="card text-centre">
      <div className="overflow">
        <img src={props.imgsrc} alt="" />
      </div>
    </div>    
  );
}

export default Card;
